const disciplines = [
    "Math",
    "Physics",
    "Music",
];

const teachers = [
    {
        name: "Abner",
        disciplines: ["Math", "Physics"],
    },
    {
        name: "Renata",
        disciplines: ["Music"],
    },
];

function Teachers() {
    return (
        <div>
            <h2>Teachers</h2>
            <ul>
                {teachers.map((teacher, index) => (
                    <li key={index}>
                        <strong>{teacher.name}</strong>
                        <ul>
                            {teacher.disciplines.map((discipline, i) => (
                                <li key={i}>{discipline}</li>
                            ))}
                        </ul>
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default Teachers;
